import React from "react";
import ScrollAnimation from 'react-animate-on-scroll';
import Navigation from '../Navigation/Navigation.js';
import './Home.css';
import Services from '../../Services.svg';

const Home = () => {
  return (
    <div>
      <Navigation />

      <div className="home-container">
        <div className="first"></div>
        <div className="second-container">
          <div id="top-slant">
            <div className="heading">
              <object type="image/svg+xml" data={Services} className="heading">

              </object>
            </div>
            <svg id="thirdslant" className="slant" viewBox="0 0 1 1" preserveAspectRatio="none">
              <polygon id="slant-one" points="0,1 1,1 1,0" />
            </svg>
          </div>
          <div className="fill">
          </div>
        </div>
        <div className="third-container">
          <div id="third-slant">
            <h2 className="heading" id="main-alt">Instagram</h2>
            <svg id="thirdslant" className="slant" viewBox="0 0 1 1" preserveAspectRatio="none">
              <polygon id="slant-two" points="0,1 1,1 1,0" />
            </svg>
          </div>
        </div>
        <div className="fourth"></div>
      </div>

    </div>
  );
};

export default Home;
